import axios from 'axios';
import prevarrow from './images/prev-arrow.png'
import nextarrow from './images/white-next-arrow.png'
import './App.css';

function App() {

  let [restaurants , setRestaurants] = useState([])

  useEffect(()=>{
    axios.get(`https://www.swiggy.com/dapi/restaurants/list/v5?lat=17.37240&lng=78.43780&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING`)
    .then((res)=>{
      setRestaurants(res.data.data?.cards[1]?.card?.card?.gridElements?.infoWithStyle?.restaurants)
    })
  },[])
  console.log(restaurants)
  return (
    <div>
      <div className = "restaurants">
        <img src = {prevarrow} alt = "arrow"/>
        <p class = "popularhead">Our Popular Restaurants</p>
        <img style = {{backgroundColor: "black"}} src = {nextarrow} alt = "arrow"/>
      </div>

      <div class="card" style = {{width: "18rem"}}>
      <img src="..." class="card-img-top" alt="..." />
      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
        <a href="#" class="btn btn-primary">Go somewhere</a>
      </div> 
      </div>   
    </div>
  );
}

export default App;
